            <path fill="#FE2C55" fill-rule="evenodd" d="M8.333.507a.437.437 0 0 0-.666 0L1.105 8.209a.437.437 0 0 0 .333.721h3.529v5.86c0 .24.196.437.437.437H10.6a.437.437 0 0 0 .437-.438V8.93h3.526a.437.437 0 0 0 .333-.72L8.333.506Z" clip-rule="evenodd"></path>
            </svg>

            {content}
